import React from "react";

function Entry(props) {
  return (
    <div className="term">
      <dt>
        <span className="preblog" role="img" aria-label="Tense Biceps">
          {props.title}
        </span>
        <span>{props.content}</span>
        <span>{props.theme}</span>
      </dt>
      <dd>{props.description}</dd>
    </div>
  );
}

export default Entry;
